import { Table } from "react-bootstrap";
import Event from "./Event";
import data from "./events_data";

const MyEvents = () => {
  const myEvents = data.filter((eve) => eve.registered === true);

  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>Event Name</th>
          <th>Organiser</th>
          <th>Date</th>
          <th>Location</th>
        </tr>
      </thead>
    </Table>
  );
};

export default MyEvents;
